import { useEffect } from "react";
import ConnectMetamask from "./ConnectMetamask.jsx";
import ConnectcontractSS from "./ConnectcontractSS.jsx";

export default function StatusofSend() {
    ConnectMetamask();
        ConnectcontractSS();
  useEffect(() => {
    const fetchData = async () => {
      try {
        

        const res = await window.contract.methods.getAllreqsent(localStorage.getItem("ROLENAME")).call();

        const res2 = await window.contract1.methods.getallreqsend(localStorage.getItem("ROLENAME")).call();

        const res3 = await window.contract2.methods.getAllAdstSend(localStorage.getItem("ROLENAME")).call();

        console.log(res, res2, res3);
      } catch (error) {
        console.log(error);
      }
    };

    fetchData();
  }, []);
}
